import React from "react";

const Leaderboard = ({ players }) => {
  return (
    <div>
      <p>
        <strong>Leaderboard</strong>
      </p>

      <h4>{players.player_1}</h4>
      <h4>{players.player_2}</h4>
    </div>
  );
};

export default Leaderboard;
